def caption_generation():
    """Caption generation page - uses Redis platform data like platform_management"""
    try:
        # Get user's platform using Redis (same as platform_management)
        platform_connection_id = None
        current_platform = None

        # Get Redis platform manager
        redis_platform_manager = app.config.get('redis_platform_manager')

        if not redis_platform_manager:
            app.logger.error("Redis platform manager not available")
            flash('Platform management system unavailable.', 'error')
            return redirect(url_for('platform_management'))

        try:
            # Get user platforms and default platform from Redis (same as platform_management)
            user_platforms = redis_platform_manager.get_user_platforms(current_user.id)
