            if current_platform_dict:
                platform_connection_id = current_platform_dict['id']
                # Convert dict to object for compatibility
                class PlatformObj:
                    def __init__(self, data):
                        for key, value in data.items():
                            setattr(self, key, value)
                current_platform = PlatformObj(current_platform_dict)
                app.logger.debug(f"Found default platform from Redis: {current_platform.name} (ID: {platform_connection_id})")
            elif user_platforms and len(user_platforms) > 0:
                # No default platform, use first available
                first_platform = user_platforms[0]
                platform_connection_id = first_platform['id']
                current_platform = PlatformObj(first_platform)
                app.logger.debug(f"Using first available platform from Redis: {current_platform.name} (ID: {platform_connection_id})")
            else:
                app.logger.warning(f"No platforms found in Redis for user {current_user.id}")

        except Exception as redis_error:
            app.logger.error(f"Redis platform lookup failed: {redis_error}")
