                    }
                    platform_connection_id = current_platform.id
                    current_platform_obj = current_platform
                    app.logger.debug(f"Found platform from database: {current_platform.name} (ID: {platform_connection_id})")

                # Step 5: Cache Back to Redis (same as platform_management)
