            finally:
                session.close()

        # Check if we found a platform (same logic as platform_management would use)
        if not current_platform_obj:
            flash('Please select a platform to continue.', 'info')
            return redirect(url_for('platform_management'))

        platform_connection_id = current_platform_obj.id

